    if (favoritItems.indexOf(seachFavList.lastChild.id) !== favoritItems.length - 1) seachFrwBtn.classList.remove("visually-hidden");
    if (favoritItems.indexOf(seachFavList.firstChild.id) === 0) seachBackBtn.classList.add("visually-hidden");
    else if (seachBackBtn.classList.contains("visually-hidden")) seachBackBtn.classList.remove("visually-hidden");
