function action(e) {
    console.log(e.target.nodeName);
    let favoritItems = JSON.parse(localStorage.getItem("favor"));
    if (e.target.nodeName === "DIV") {
        console.log(e.currentTarget.id);
        let idxOfDelElem = favoritItems.indexOf(`${e.currentTarget.id}`);
        favoritItems.splice(idxOfDelElem, 1);
        localStorage.setItem("favor", JSON.stringify(favoritItems));
        countFav();
    } else fetchWeather(e.currentTarget.id);
}
async function countFav() {
    if (localStorage.getItem("favor")) {
        let favoritItems = JSON.parse(localStorage.getItem("favor"));
        if (window.outerWidth <= 767 && favoritItems.length > 2) favoritItems.splice(2);
        else if (window.outerWidth > 767 && favoritItems.length > 4) favoritItems.splice(4);
        await renderFavList(favoritItems);
        const FavElem = document.querySelectorAll(".seach-favorite-item");
        FavElem.forEach((x)=>x.addEventListener("click", action));
    }
}
async function nextSeachElem() {
    let favoritItems = JSON.parse(localStorage.getItem("favor"));
    if (favoritItems.indexOf(seachFavList.lastChild.id) !== favoritItems.length - 1) {
        if (window.outerWidth <= 767) favoritItems = favoritItems.splice(favoritItems.indexOf(seachFavList.lastChild.id), 2);
        else if (window.outerWidth > 767) favoritItems = favoritItems.splice(favoritItems.indexOf(seachFavList.lastChild.id) - 2, 4);
    } else console.log("\u042D\u0442\u043E \u043A\u043E\u043D\u0435\u0446");
    await renderFavList(favoritItems);
    const FavElem = document.querySelectorAll(".seach-favorite-item");
    FavElem.forEach((x)=>x.addEventListener("click", action));
}
async function prevSeachElem() {
    let favoritItems = JSON.parse(localStorage.getItem("favor"));
    if (window.outerWidth <= 767) favoritItems = favoritItems.splice(favoritItems.indexOf(seachFavList.firstChild.id) - 1, 2);
    else if (window.outerWidth > 767) favoritItems = favoritItems.splice(favoritItems.indexOf(seachFavList.firstChild.id) - 1, 4);
    await renderFavList(favoritItems);
    const FavElem = document.querySelectorAll(".seach-favorite-item");
    FavElem.forEach((x)=>x.addEventListener("click", action));
}
countFav();

